import React, { useState , useEffect } from 'react'
import Header from './components/Header/Header';
import Footer from './components/Footer/Footer';
import LandingPage from './components/LandingPage/LandingPage'; // Corrected path
import Find from './components/Find/Find'; // Import the Find component
import { BrowserRouter as Router, Ro, Route } from "react-router-dom";

function App() {
  return (
    <>
     <Router>
        <Header />
        <Route>
          <Route exact path="/" component={LandingPage}></Route>
          {/* <Route exact path="/user" component={}></Route> */}
          {/* <Route exact path="/dashboard" component={Dashboard}></Route> */}
          {/* <Route exact path="/exercise" component={Exercises}></Route> */}
          {/* <Route exact path="*" component={Error}></Route> */}
        </Route>

        <Router>
      <Routes>
        <Route path="/" element={<Home />} />  {/* Route for Home page */}
        <Route path="/find" element={<Find />} />  {/* Route for Find page */}
        {/* Add more routes as needed */}
      </Routes>
    </Router>
        <Footer/>
      </Router>

    </>
  )
}

export default App;
